  input: '"TEXT","F3A","","This amendment has 2 major changes.      We switched from
    reporting on FEC software to NGP software.  The 1st difference is the reporting
    of credit card contributions transfered to us by the DCCC.  Under FECfile, when
    the DCCC wrote a check to our committee for credit card donations they collected
    on our behalf they were reported under Contributions From Political Party Committees
    #11(b).  In this report they are reported under Transfers From Authorized Committees
    #12.    The 2nd change in this amendment is an error discovered when switching
    software.  A donation from David Phillips for $1000, received 3/31/06, was reported
    in 1Q2006 and was mistakenly counted again in 2Q2006. Therefore the total contributions
    are $1000 less than the original report.     If you have any questions please
    call Sue Carne at 775-267-9668 or 775-783-1416.      ",""'
